import React from 'react';
import './home.css';
import Footer from './footer';
import book from './homeAssets/book.png';
import chest from './homeAssets/chest.png';
import reward from './homeAssets/trophy.png';
import star from './homeAssets/star.png';

function Home() {
  const enterLesson = () => {
    // Gérer l'événement de clic du bouton ici
    console.log('Bouton rond cliqué !');
  };

  return (
    <div className="app-container">
      <header className="header">
        <div className='sectionTitle'>
          <h1>Chapitre 1</h1>
          <p>Apprendre l'alphabet</p>
        </div>
        <img src={book} alt="lesson-icon" className="iconHeader" />
      </header>

      <main className="main-content">
        <div className="publicity">
          <h1>Publicity</h1>
        </div>
        <div className="lessonSection">

          <button className="round-button button-line" onClick={enterLesson}>
            <img src={star} alt="Icon" className="button-icon" />
          </button>
          <button className="round-button button-line locked" onClick={enterLesson}>
            <img src={star} alt="Icon" className="button-icon" />
          </button>
          <button className="round-button locked" onClick={enterLesson}>
            <img src={chest} alt="Icon" className="button-icon" />
          </button>
          <button className="round-button locked" onClick={enterLesson}>
            <img src={star} alt="Icon" className="button-icon" />
          </button>
          <button className="round-button locked" onClick={enterLesson}>
            <img src={star} alt="Icon" className="button-icon" />
          </button>
          <button className="round-button locked" onClick={enterLesson}>
            <img src={reward} alt="Icon" className="button-icon" />
          </button>
        </div>
        <div className="publicity">
          <h1>Publicity</h1>
        </div>

      </main>
      <Footer />

    </div>
  );
}

export default Home;
